/**
 * @param {string} s
 * @return {number}
 */


const lengthOfLongestSubstring = (s) => {
  const len = s.length
  let bestLen = 0
  let currentStr = ''
  for (let i = 0; i < len; i++) {
    const sameAt = currentStr.indexOf(s[i])
    // console.log('before',currentStr, s[i], sameAt)
    if (sameAt == -1) {
      currentStr = currentStr + s[i]
    } else {
      currentStr = currentStr.substr(sameAt + 1, currentStr.length) + s[i]
    }
    // console.log('after',currentStr, currentStr.length, bestLen)
    if (currentStr.length > bestLen) {
      bestLen = currentStr.length
    }
  }

  return bestLen
};

